import React from "react"
import { View, Text } from "react-native"
export const LoginScreen = () => {
    return (
        <View style={{
            flex : 1,
            backgroundColor : 'lightblue'
        }}>
            <View>
                <Text style={{
                    fontSize : 48,
                    fontWeight : '600',
                    color : 'white'
                }}>Login</Text>
            </View>
            <View style={{
                width : '100%',
                height : '70%',
                backgroundColor : 'white',
                borderRadius : 20,
                position : 'absolute',
                bottom : 0
            }}>

            </View>
        </View>
    )
}
